import React from "react";
import styled from "styled-components";

const Navbar = () => {
  return (
    <>
      <NavContainer>
        <h2>
          Navbar<span>Responsive</span>
        </h2>
      </NavContainer>
    </>
  );
};

export default Navbar;
const NavContainer = styled.nav;
